import React from "react"
import axios from "axios"

class ShowUsers extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            users: []
        }
    }


componentDidMount() {
    axios.get("http://localhost:3030/users/")
    .then(response => {
        this.setState({
            users: response.data
        })
    })
}

    render() {
        return(
            <div>
                <h1>Liste des Utilisateurs</h1>

            </div>
        )
    }
}

export default ShowUsers
